  string VectorToString(vector<string> vector_, string delim_)
  {
    ostringstream vts;
    if (!vector_.empty())
    {
      std::copy(vector_.begin(), vector_.end() - 1,
        ostream_iterator<string>(vts, delim_.c_str()));
      vts << vector_.back();
    }
    return vts.str();
  }